<!DOCTYPE html><html lang="zh-CN"><head>  <title>推荐壁纸</title>  <meta name="viewport" content="width=device-width,height=device-height,inital-scale=1.0,maximum-scale=1.0,user-scalable=no;"><meta name="apple-mobile-web-app-capable" content="yes"><meta name="apple-mobile-web-app-status-bar-style" content="black"><meta name="format-detection" content="telephone=no"><!--手机端浏览-->  <style type="text/css">        .gallery-photos{width:100%;}.gallery-photo{width:24.9%;position: relative;visibility: hidden;overflow: hidden;}.gallery-photo.visible{visibility: visible;animation: fadeIn 2s;}.gallery-photo img{display: block;width:100%;border-radius:0;padding:4px;animation: fadeIn 1s;cursor: pointer;transition: all .4s ease-in-out;}.gallery-photo span.photo-title,.gallery-photo span.photo-time{background: rgba(0, 0, 0, 0.3);padding:0px 8px;font-size:0.9rem;color: #fff;display:none;animation: fadeIn 1s;}.gallery-photo span.photo-title{position:absolute;bottom:4px;left:4px;}.gallery-photo span.photo-time{position:absolute;top:4px;left:4px;font-size:0.8rem;}.gallery-photo:hover span.photo-title{display:block;}.gallery-photo:hover img{transform: scale(1.1);}@media screen and (max-width: 1800px) {  .gallery-photo{width:33.3%;}}@media screen and (max-width: 860px) {  .gallery-photo{width:49.9%;}}@keyframes fadeIn{  0% {opacity: 0;}   100% {opacity: 1;}}  </style></head><body><script src="https://immmmm.com/waterfall.min.js"></script><script src="https://immmmm.com/imgStatus.min.js"></script><script>document.addEventListener('DOMContentLoaded', () => {  //外链 gallery 标签相册瀑布流  var photosAll = document.getElementsByTagName('gallery') || '';  if(photosAll){    for(var i=0;i < photosAll.length;i++){      photosAll[i].innerHTML = '<div class="gallery-photos">'+photosAll[i].innerHTML+'</div>'      var photosIMG = photosAll[i].getElementsByTagName('img')      for(var j=0;j < photosIMG.length;j++){        wrap(photosIMG[j], document.createElement('div'));      }    }  }  function wrap(el, wrapper) {    wrapper.className = "gallery-photo";    el.parentNode.insertBefore(wrapper, el);    wrapper.appendChild(el);  }  //相册瀑布流  let galleryPhotos = document.querySelectorAll('.gallery-photos') || ''  if(galleryPhotos){    imgStatus.watch('.gallery-photo img', function(imgs) {      if(imgs.isDone()){        for(var i=0;i < galleryPhotos.length;i++){          waterfall(galleryPhotos[i]);          let pagePhoto = galleryPhotos[i].querySelectorAll('.gallery-photo');          for(var j=0;j < pagePhoto.length;j++){pagePhoto[j].className += " visible"};        }      }    });    window.addEventListener('resize', function () {      for(var i=0;i < galleryPhotos.length;i++){        waterfall(galleryPhotos[i]);      }    });  }});</script><gallery>   <img src=https://pica.zhimg.com/80/v2-6d04f6e5636dd1072455dc50acdc9588.jpeg><br><img src=https://pic2.zhimg.com/v2-f783660f6bd3e2875dda9ad7874cd834_r.jpg?source=1940ef5c><br><img src=https://pica.zhimg.com/80/v2-922bd19de4a0b41c88fc4c9d33768053.png><br><img src=https://pic1.zhimg.com/v2-2f0c19aea2e874b7cc8a4c17f2dfbe60_r.webp><br><img src=https://picx.zhimg.com/v2-209732d147d6e019fd076c650b8828ba_r.webp?source=1940ef5c><br><img src=https://picx.zhimg.com/v2-1699acc030b9aafbe3941475d7c7f75f_r.webp?source=1940ef5c><br><img src=https://picx.zhimg.com/v2-fec1574b64cb1cdfa87598a3debc7a81_r.webp?source=1940ef5c><br><img src=https://pic3.zhimg.com/v2-b98868f471d2f78cd57659987a067c53_r.jpg?source=1940ef5c><br><img src=https://img.tucang.cc/api/image/show/d1f12f6ef76778637770e59779f2687c><br><img src=https://pic3.zhimg.com/v2-1a00b23d760c54b64d3030061275cbed_r.jpg?source=1940ef5c><br><img src=https://pic2.zhimg.com/v2-69acec6043399767554773a47c3b5479_r.jpg><br><img src=https://pic2.zhimg.com/v2-1f8e8d2a4825c9272f291fa0a2f1773e_r.jpg?source=1940ef5c><br><img src=https://pic1.zhimg.com/v2-a7416c9d338d3e5ec07cf1c2998ccc31_r.jpg?source=1940ef5c><br><img
